<!DOCTYPE html>
<meta charset="utf-8">

<title>demo2</title>

<script src="js/libs/jquery-1.10.2.js"></script>
<script src="js/libs/underscore-1.5.2.js"></script>
<script src="js/libs/d3.v3.min.js"></script>

<link  href="js/treeInspector/css.css" rel="stylesheet">
<script src="js/treeInspector/treeInspector.js"></script>

<script>
$(function () {

  function draw (g, i) {

    if (g === undefined) {
      g = parseInt($('#gen-select').val());
    }

    if (i === undefined) {
      i = parseInt($('#tree-select').val());
    }

    var $area = $('#input-area');
    var trees = JSON.parse($area.val());
    
    if ($('#pretty-print').prop('checked')) {
      $area.val(JSON.stringify(trees, undefined, 2));
    }

    var $selectGen = $('#gen-select');
    $selectGen.html('');
    _.each(trees, function (el, ge) {
      var $opt = $('<option>').val(ge).html('['+ge+']');
      if (g==ge) { $opt.attr('selected','1'); }
      $selectGen.append($opt);
    });

    var $selectTree = $('#tree-select');
    $selectTree.html('');
    _.each(trees[g], function (tree, j) {
      var $opt = $('<option>').val(j).html('['+j+'] '+tree.fitval);
      if (i==j) { $opt.attr('selected','1'); }
      $selectTree.append($opt);
    });
    
    var treeToShow = trees[g][i].term;

    TreeInspector.mk({
      tree: TreeInspector.transformTree(treeToShow),
      div: '#box',
      margin: {top: 10, right: 0, bottom: 10, left: 50},
      width:  960,
      height: 300, //($(window).height()-150)/4,
    });  
  }

  draw(0,0);

  $('#draw-butt').click(function(){
    draw(0,0);
  });

  $('#tree-select').change(function(){
    draw();
  });

  $('#gen-select') .change(function(){
    draw(undefined,0);
  });



});
</script>
